import React, { useEffect } from "react";
import styles from "./Men.module.css";
const Men = (props) => {
  useEffect(() => {
    props.setNavIndex(0);
  }, []);
  useEffect(() => {
    props.setUserColor("white");
  });

  return (
    <div className={styles.men}>
      <div className="container"></div>
    </div>
  );
};
export default Men;
